import React, { Component } from 'react';
import '../../statics/style/header.css';


class Header extends Component{
    constructor(props) {
        super(props);


    }
    render(){
        return(
                <div className="nav-div">
                    <ul className="nav-ul">
                        <li>
                            <a href="/">
                                <img className="nav-logo"/>
                            </a>
                        </li>
                        <li>推荐</li>
                        <li>排行榜</li>
                        <li>歌单</li>
                        <li>主播电台</li>
                        <li>歌手</li>
                        <li>新碟上架</li>
                        <li>登录</li>
                    </ul>
                </div>
        )
    }
}

export default Header;
